import React from "react";
import Product from "../components/Product";

const productCreation = () => {
  return (
    <div className="creation-page">
      <div className="new-product">
        <Product />
      </div>
      <div>
        <form action="">
          <label htmlFor=""></label>
          <input type="text" />
        </form>
      </div>
    </div>
  );
};

export default productCreation;
